const NavBar = () => {
    return (  
        <nav className="navbar">
            <h1>Welcome to UBuy.com!</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/search"></a>
                <a href="/account"></a>
                <a href="/item"></a>
            </div>
        </nav>
    );
}
 
export default NavBar;
